import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { HttpClient } from '@angular/common/http';
@Component({
  selector: 'app-doctorlogin',
  templateUrl: './doctorlogin.component.html',
  styleUrls: ['./doctorlogin.component.css']
})
export class DoctorLoginComponent implements OnInit {
  email: string = '';
  password: string = '';
  role: string = '';
  error: string | null = null;
  userdetails: any = { email: '', password: '', role: '' };
  onRecaptchaChange: boolean = false;

  constructor(private router: Router, private http: HttpClient) {}

  ngOnInit() {
    // Angular equivalent of useEffect
  }

  checkMail(data: string): boolean {
    const emailRegex: RegExp = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
    return emailRegex.test(data);
  }

  call(): void {
    const data = {
      email: this.email,
      password: this.password,
      role: 'Doctor'
    };

    if (data.role === this.userdetails.role) {
      if (data.email === this.userdetails.email) {
        if (data.password === this.userdetails.password) {
          this.router.navigate(['/DoctorAppointment']);
        } else {
          this.handleError('INVALID PASSWORD');
        }
      } else {
        this.handleError('INVALID EMAIL');
      }
    } else {
      if (data.role !== 'Doctor') {
        this.handleError('INVALID ROLE');
      }
    }
  }

  async login(): Promise<void> {
    const data = {
      email: this.email,
      password: this.password,
      role: 'Doctor'
    };

    if (this.onRecaptchaChange) {
      if (this.checkMail(this.email)) {
        if (this.password.length >= 5) {
          try {
            const response = await this.http.post<any>('http://localhost:1111/officialEmail/', data).toPromise();
            this.role = response.data.role;
            this.userdetails = {
              email: response.data.email,
              password: response.data.password,
              role: response.data.role
            };
            this.call();
          } catch (error) {
            this.handleError('INVALID USER');
            console.error('Error:', error);
          }
        } else {
          this.handleError('5 CHARACTER NEED PASSWORD');
        }
      } else {
        this.handleError('ENTER PROPER EMAIL');
      }
    } else {
      this.handleError('VERIFY CAPTCHA');
    }
  }

  hideError(): void {
    this.error = null;
  }

  handleError(message: string): void {
    this.error = message;
    setTimeout(() => this.hideError(), 1000);
  }
}
